    "hawaii-coral-reef-assessment-and-monitoring-program-cramp-fish-data-from-2000-nodc-accession-00d72d7",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset consists of CRAMP surveys
    taken in 2000 and includes quantitative estimates of fish species richness, abundance,
    and biomass. There are 32 survey sites, with most of these having both a shallow
    and deep transect. These sites are located on Kauai, Oahu, Maui, Kahoolawe, and
    Hawaii. Typically, one sampling date was made for each site per year. Annual surveys
    are scheduled at these sites and additional sites through at least 2002.",nt"license_title":
